import React, { useState } from "react";
import { Form, Button, InputGroup } from "react-bootstrap";
import "../styles/SearchHeader.css";

const SearchHeader = () => {
  const [view, setView] = useState("grid");
  const [priceRange, setPriceRange] = useState([120, 1187500]);
  const [sort, setSort] = useState("");

  const handlePriceChange = (index, value) => {
    const updatedRange = [...priceRange];
    updatedRange[index] = value;
    setPriceRange(updatedRange);
  };

  return (
    <div className="search-header py-3 px-4 bg-light mt-4">
      <div className="d-flex flex-column flex-md-row justify-content-between align-items-center">
        {/* Left Section */}
        <div>
          <h4 className="fw-bold">Wedding Venues in Chennai</h4>
          <p className="text-muted mb-0">
            Showing <span className="fw-bold">1533</span> results as per your
            search criteria
          </p>
        </div>

        {/* Right Section */}
        <div className="d-flex align-items-center mt-3 mt-md-0">
          {/* Search Box */}
          <InputGroup className="search-box me-3">
            <InputGroup.Text>
              <i className="bi bi-search"></i>
            </InputGroup.Text>
            <Form.Control placeholder="Search Wedding Venues..." />
          </InputGroup>

          {/* List/Grid Toggle */}
          <div className="d-flex align-items-center toggle-view">
            <i
              className={`bi bi-list-ul me-2 ${view === "list" ? "active" : ""}`}
              onClick={() => setView("list")}
            ></i>
            <span className={`me-3 ${view === "list" ? "text-primary" : ""}`}>
              List
            </span>
            <i
              className={`bi bi-grid-3x3-gap-fill me-2 ${
                view === "grid" ? "active" : ""
              }`}
              onClick={() => setView("grid")}
            ></i>
            <span className={`${view === "grid" ? "text-primary" : ""}`}>
              Grid
            </span>
          </div>
        </div>
      </div>

      {/* Price Range Filter */}
      <div className="mt-4 d-flex flex-column flex-md-row align-items-center">
        <div className="me-3">
          <h6 className="mb-2">Price</h6>
          <div className="d-flex align-items-center">
            <input
              type="number"
              className="form-control range-input me-2"
              value={priceRange[0]}
              min="120"
              max={priceRange[1]}
              onChange={(e) => handlePriceChange(0, Number(e.target.value))}
            />
            <div className="price-slider mx-2">
              <input
                type="range"
                min="120"
                max="1187500"
                value={priceRange[0]}
                onChange={(e) => handlePriceChange(0, Number(e.target.value))}
                className="range"
              />
              <input
                type="range"
                min="120"
                max="1187500"
                value={priceRange[1]}
                onChange={(e) => handlePriceChange(1, Number(e.target.value))}
                className="range"
              />
            </div>
            <input
              type="number"
              className="form-control range-input ms-2"
              value={priceRange[1]}
              min={priceRange[0]}
              max="1187500"
              onChange={(e) => handlePriceChange(1, Number(e.target.value))}
            />
          </div>
        </div>
        <Button variant="primary" className="mt-3 mt-md-0">
          Go
        </Button>
      </div>

      {/* Sorting Buttons */}
      <div className="mt-3">
        <h6 className="mb-2">Sort By</h6>
        <div className="d-flex gap-2">
          <Button
            variant={sort === "Price (Low to High)" ? "primary" : "light"}
            onClick={() => setSort("Price (Low to High)")}
          >
            Price (Low to High)
          </Button>
          <Button
            variant={sort === "Price (High to Low)" ? "primary" : "light"}
            onClick={() => setSort("Price (High to Low)")}
          >
            Price (High to Low)
          </Button>
          <Button
            variant={sort === "Rating (High to Low)" ? "primary" : "light"}
            onClick={() => setSort("Rating (High to Low)")}
          >
            Rating (High to Low)
          </Button>
        </div>
      </div>
    </div>
  );
};

export default SearchHeader;
